package com.demo.galleryservice;

import java.sql.Date;

import javax.annotation.PostConstruct;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.cloud.client.discovery.EnableDiscoveryClient;

import com.demo.galleryservice.model.Image;
import com.demo.galleryservice.repository.GalleryRepository;

@SpringBootApplication
@EnableDiscoveryClient
public class GalleryServiceApplication {

	public static void main(String[] args) {
		SpringApplication.run(GalleryServiceApplication.class, args);
	}

	@Autowired
	GalleryRepository galleryRepository;

	@PostConstruct
	public void savedetails() {
		Image image = new Image();
		image.setImage(
				"");
		image.setUploadedDate(new Date(System.currentTimeMillis()));
		image.setUploaderEmpId(2332530L);
		galleryRepository.save(image);
	}

}
